import React from 'react';

import './App.css';

const App = () => {
  return (
    <div className="app-wrapper">
      <header className>
        <img src="https://www.freepnglogos.com/uploads/eagles-png-logo/eagle-sports-png-logos--0.png" />
      </header>
      <nav>
        <div>Profile</div>
        <div>Messages</div>
        <div>News</div>
      </nav>
      <div>Main content</div>
    </div>
  );
}

export default App;
